import React, { Component } from "react";

class Search extends Component {
  render() {
    return (
      <div>
        <form className='form'>
          <input style={formStyles} type='text' name='text' />
          <input
            type='submit'
            value='Search'
            className='btn btn-block btn-dark'
          />
        </form>
      </div>
    );
  }
}

const formStyles = {
  outlineColor: " #dc3545",
};

export default Search;
